  return (

    <div>
      {/* <img src={thumbnail}/> */}
      {/* <p>{album}</p>
      <p>{year}</p> */}
      {/* <p>{description}</p>
       */}
     <Figure>
       <Figure.Image 
        width={171}
        height={180}
        alt="171x180"
        src= {thumbnail}
      />
